You can get difference of two sets using the difference() method: {1, 2, 3}.difference({3, 4, 5})
# => {1, 2} Note that the operation is not commutative: {3, 4, 5}.difference({1, 2, 3})
# => {4, 5} Alternatively, you can use the - operator: {1, 2, 3} - {3, 4, 5}
# => {1, 2}

