The if-elif-else statement allows you to specify multiple alternative actions. It's allowed to have multiple elif statements, but only one else statement. if conditional_test_1: # do something
elif conditional_test_2: # do something different
elif conditional_test_3: # do something event more different
else: # do something else We can now write more ellaborate classification of cars: car = "Mercedes" if car.lower() == "bmw": print("Your car is awesome!")
elif car.lower() == "mercedes": print("Your car is expensive!")
elif car.lower() == "ferarri": print("Your car is fast!")
else: print("Your car is okay...") print("Have a nice day!") Your car is expensive!
Have a nice day! In this example, once car.lower() == "mercedes" evaluates to True, the rest of the elif statements, and the else statement, are skipped. The else statement is optional. It is used to specify an action if none of the if or elif statements evaluate to True. And it must be the last statement in the if statement.

