To get the union of two sets, you can use the union() method: {1, 2, 3}.union({3, 4, 5})
# => {1, 2, 3, 4, 5} Or, alternatively, you can use the | operator: {1, 2, 3} | {3, 4, 5}
# => {1, 2, 3, 4, 5}
